uploadtext:
Лелайе хӀара агӀо сервер чу файлаш йохуш.
Хьалхо чуйаьхна файлаш хьажа,  [[Special:FileList|кхузахь]]. Кхин чуйаьхна файлаш дӀайазло [[Special:Log/upload|чуйахаран журнал чохь]], дӀайаьхна файлаш каро йиш йу [[Special:Log/delete|кхузахь]].

Файл агӀонан чуйилла лелабе лахара могӀанаш:
* '''<code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.jpg]]</nowiki></code>''' Файлан йуьззина верси чуйиллуш;
* '''<code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.png|200px|thumb|left|цуьнах лаьцна хаам]]</nowiki></code>''' 200 пиксель барамехь файл чуйиллар бухахь цуьнах лаьцна могӀа а болуш;
* '''<code><nowiki>[[</nowiki>{{ns:media}}<nowiki>:File.ogg]]</nowiki></code>''' файлан тӀе хьажорг хӀотайо файл агӀонгахь цагуш.

